import React, {useEffect} from "react";
import { useDispatch, useSelector} from "react-redux";
import { getAllDogs } from "../../redux/action-creators";

export const Home = () => {
    const dispatch = useDispatch();
    const allDogs = useSelector((state) => state.allDogs);

    useEffect(() => {
        dispatch(getAllDogs())
    }, [])

    console.log(allDogs);

    return (
        <div>
            Home
        </div>
    )
}
